import "./Header.css";

import { Link } from "react-router-dom";

function Header() {
  return (
    <div style={{ marginBottom: "20px" }}>
      <h1>Invoice Management System</h1>

      <nav>
        <Link to="/" style={{ marginRight: "15px" }}>Invoices</Link>
        <Link to="/add">Add Invoice</Link>
      </nav>

      <hr />
    </div>
  );
}

export default Header;
